// src/components/SidePanelRight.js
import React from "react";
import "./SidePanelRight.css";
import { Map, Users, Alien, Home, Cloud, Circle, Moon } from "lucide-react";

const SidePanelRight = ({ onLayerToggle }) => {
  return (
    <div className="side-panel-right">
      <button title="רשויות" onClick={() => onLayerToggle("municipalities")}>
        <Map size={24} />
      </button>
      <button title="נחיתות" onClick={() => onLayerToggle("landings")}>
        <Users size={24} />
      </button>
      <button title="חייזרים" onClick={() => onLayerToggle("aliens")}>
        <Alien size={24} />
      </button>
      <button title="מקלטים" onClick={() => onLayerToggle("shelters")}>
        <Home size={24} />
      </button>
      <button title="מזג אוויר" onClick={() => onLayerToggle("weather")}>
        <Cloud size={24} />
      </button>
      <button disabled>
        <Circle size={20} strokeWidth={1} />
      </button>
      <button disabled>
        <Circle size={20} strokeWidth={1} />
      </button>
      <button title="מצב לילה">
        <Moon size={24} />
      </button>
    </div>
  );
};

export default SidePanelRight;
